import React from 'react';
import './Explore.css';

function Explore() {
  const places = [
    {
      name: 'Paris',
      description: 'The city of lights and love, known for the Eiffel Tower and exquisite cuisine.',
      image: 'https://via.placeholder.com/300x200?text=Paris',
    },
    {
      name: 'Maldives',
      description: 'A tropical paradise with crystal-clear waters and white sandy beaches.',
      image: 'https://via.placeholder.com/300x200?text=Maldives',
    },
    {
      name: 'Tokyo',
      description: 'A bustling metropolis blending traditional culture with modern technology.',
      image: 'https://via.placeholder.com/300x200?text=Tokyo',
    },
  ];

  return (
    <section className="explore">
      <h2>Explore</h2>
      <div className="places">
        {places.map((place, index) => (
          <div className="place-card" key={index}>
            <img src={place.image} alt={place.name} />
            <h3>{place.name}</h3>
            <p>{place.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Explore;
